import React from 'react';

const Display = (props) => {
    return (<div>
        Your details:
            <div>{props.firstname + " " + props.lastname}</div>
            <div>{props.email}</div>
            <div>{props.mobile}</div>
            <div>{props.dob}</div>
            <div>{props.gender}</div>
            <div>{props.course}</div>
            <div>{props.agree}</div>
            

    </div>);
}

export default Display;
